const ProductCard = ({ product }) => {
  return (
    <div className="product-card">
      <img 
        src={`http://localhost:5000/images/${product.image}`} 
        alt={product.name} 
        style={{ width: '100%', height: 'auto' }}
      />
      <h3>{product.name}</h3>
      <p>{product.category}</p>
      <p>{`$${product.price}`}</p>
    </div>
  );
};

export default ProductCard;
